import React, { Component } from 'react';
import AddTopicos from './addTopicos';
import UpdateTopic from './updateTopics';
import AddContent from './addContent';


class Gerenciador extends Component {

    state = {
        addTopics:false,
        updateTopic:false,
        addContent:false

    }


    render() { 


        return (
            <React.Fragment>
                <AddTopicos/>
                <UpdateTopic visibilidade = {this.state.updateTopic} catalogos = {this.props.catalogos}/>
                <AddContent catalogos = {this.props.catalogos}/>
            </React.Fragment>

        );
    }
}

export default Gerenciador;
